// TopNav.jsx
import { useState } from 'react';
import { FiMenu } from 'react-icons/fi';

const TopNav = ({ onMenuClick }) => {
  return (
    <div className="bg-[#232f3e] text-white px-6 py-4 flex justify-between items-center">
      <button onClick={onMenuClick} className="text-xl">
        <FiMenu />
      </button>
      <h1 className="text-lg font-semibold">amazon vendor central</h1>
      <div className="space-x-4">
        {/* icons if needed */}
      </div>
    </div>
  );
};

export default TopNav;
